import React from 'react';
import Header from './contents/Header';
import Patrocinador from './contents/Patrocinador';
import Contact from './contents/Contact';

function App() {
  return (
    <div class="tudo">
      <Header/>
      <a name="patrocinadores"><Patrocinador /></a>
      <a name="contato"></a><Contact/>
    </div>
  )
}

export default App;
